    "epa-sole-source-aquifers",nt"isopen": false,nt"url": null,nt"notes":
    "Information on sole source aquifers (SSAs) is widely used in assessments under
    the National Environmental Policy Act and at the state and local level. A national
    layer, including all available SSA coverages, is available for use in GIS. This
    layer includes the GIS polygons for SSAs. In addition to single SSA designated area
    polygons, some EPA regional offices have delineated GIS layers for: * Streamflow
    zones * Aquifer recharge areas * Other features at the land surface important for
    SSA designations. The SSA geospatial data set is available through Data.gov for
    use by government agencies, private organizations, and the public.",nt"license_title":
